import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  font-family: 'Neue Montreal', 'Segoe UI', sans-serif;
  padding: 4rem 2rem;
  background: url('/assets/pattern.png') repeat;
  min-height: 100vh;
`;

const Title = styled.h1`
  font-size: 2.5rem;
  color: #229EBC;
  margin-bottom: 2rem;
`;

const Section = styled.section`
  margin-bottom: 2rem;
`;

const Heading = styled.h2`
  font-size: 1.5rem;
  color: #013047;
`;

const Text = styled.p`
  max-width: 800px;
`;

export default function DashboardPage() {
  return (
    <Wrapper>
      <Title>Dashboard</Title>
      <Section>
        <Heading>Overview</Heading>
        <Text>View key insights and workflow summaries from your Microsoft 365 environment.</Text>
      </Section>
      <Section>
        <Heading>Users</Heading>
        <Text>Manage employee accounts and collaboration tools.</Text>
      </Section>
      <Section>
        <Heading>Licenses</Heading>
        <Text>Monitor and assign licenses for Microsoft 365 Business Basic.</Text>
      </Section>
    </Wrapper>
  );
}
